        public ApplicationDbContext(DbContextOptions<ApplicationDbContext> options) : base(options) {}

        /// <summary>
        /// Stored Procedure: Get total amount funded as of given date
        /// </summary>
        /// <param name="asOfDate"></param>
        /// <returns></returns>
        public async Task<decimal> SPGetTotalLoanFundedToDate(DateTime? asOfDate)
        {
            FormattableString sqlQuery = $"exec [dbo].[GetTotalLoanFundedToDate] @FundingAsOf, @TotalFunding OUT";

            SqlParameter fundingAsOf = new SqlParameter("@FundingAsOf", SqlDbType.DateTime) { Value = asOfDate.Value };

            SqlParameter output = new SqlParameter("@TotalFunding", SqlDbType.Decimal)
            {
                Direction = ParameterDirection.Output,
                Precision = 18,
                Scale = 2
            };

            var result = await Database.ExecuteSqlRawAsync(sqlQuery.ToString(), fundingAsOf, output);

            return (decimal)output.Value;
        }

        /// <summary>
        /// Stored Procedure: Get modified property list as of target date with appraisal date prior to target date
        /// </summary>
        /// <param name="asOfDate">Properties modified as of this date</param>
        /// <returns></returns>
        public async Task<List<ModifiedProperty>> SPGetModifiedProperties(DateTime? asOfDate)
        {
            FormattableString sqlQuery = $"exec [dbo].[GetModifiedPropertiesAsOfDate] @asOfDate";

            SqlParameter modifiedAsOf = new SqlParameter("@asOfDate", SqlDbType.DateTime) { Value = asOfDate.Value };

            return await SP_ModifiedProperties.FromSqlRaw(sqlQuery.ToString(), modifiedAsOf).ToListAsync();
        }

        /// <summary>
        /// Stored Procedure: Get partner certificate with share details
        /// </summary>
        /// <returns></returns>
        public async Task<List<PartnerCertificateDetails>> SPGetPartnerCertificates()
        {
            FormattableString sqlQuery = $"exec [dbo].[GetPartnerCertificates]";

            return await SP_PartnerCertificateDetails.FromSqlRaw(sqlQuery.ToString()).ToListAsync();
        }
        public async Task<List<GetUserData>> SPGetUserData()
        {
            FormattableString sqlQuery = $"exec [dbo].[GetUserData]";

            return await SP_GetUserData.FromSqlRaw(sqlQuery.ToString()).ToListAsync();
        }
        /// <summary>
        /// Stored Procedure: Get partner transaction details
        /// </summary>
        /// <param name="startDate"></param>
        /// <param name="endDate"></param>
        /// <returns></returns>
        public async Task<List<PartnerTransactionDetails>> SPGetPartnerTransactions(DateTime? startDate = null, DateTime? endDate = null)
        {
            FormattableString sqlQuery = $"exec [dbo].[GetPartnerTransactions] @StartDate, @EndDate";

            SqlParameter pStartDate = new SqlParameter("@StartDate", SqlDbType.DateTime) { Value = startDate };
            SqlParameter pEndDate = new SqlParameter("@EndDate", SqlDbType.DateTime) { Value = endDate };

            return await SP_PartnerTransactionDetails.FromSqlRaw(sqlQuery.ToString(), pStartDate, pEndDate).ToListAsync();
        }

